import Button from './components/Button';
import './App.css';

function App() {
  return (
    <div className="App">

      <h1>Olá React</h1>
      <Button title= "Entrar"/>
      <Button title= "Fechar"/>
      <Button title= "Abrir"/>
      <Button title= "Salvar"/>
    </div>
  );
}

export default App;
